ais une sorte de bande dessinée sur des papiers comme des rouleaux à chiottes, mais c’était pour imprimer des comptes. Ça allait dans des machines. Je faisais des immenses histoires, des cirques interminables. Et dans les cirques, il y avait la fosse d’orchestre qui était en hauteur.[...] Je dessinais beaucoup d’indiens avec des tambours et les fameux boum boum boum ! Tous ces trucs, ça fascinait. Ce qui m’a carrément illuminé, c’est les reflets à Tours où j’ai de la famille, par une lucarne de chez ma cousine couturière Alice, un 14 juillet. Les pompiers défilaient, avec les tambours au premier plan. Ça m’a achevé, si je peux dire… J’étais déjà dans un domaine où il y avait tout le temps une rythmique ou quelque chose de rythmique. J’ai suivi ce qui me plaisait le mieux et ça a abouti au premier tam-tam, avec des palmiers rouges sur fond jaune et un ou deux trucs verts, des couleurs qui vont pas du tout ensemble, et au pochoir, déjà. J’avais sept ans.\"','Virginie ou le manque de tact','Jacques Thollot','09 Virginie ou le manque de tact.mp3','4d87174d6350a02a0e5aa0578b09a5e9',NULL,'2011-02-23 15:45:00',1,42,'2011-02-23 16:03:34','2015-10-16 05:26:48','jacques-thollot-virginie-ou-le-manque-de-tact',''),(1337,'Ah oui mais NaoN , c\'est vrai! ','J\'ai fait caca','Robot Caca','robotcaca-jaifaitcaca.mp3','432bf8362d1a250531fef0efd1c9f801',NULL,'2011-02-23 20:35:00',1,38,'2011-02-23 20:39:05','2015-10-16 05:26:48','robot-caca-j-ai-fait-caca',''),(1338,'28 secondes. Du concentré de n\'importe quoi que je trouve parfait !\r\n','j-ai fait une salade de calamars avec des restes de ciconcision de Cédric M. (donc pas grand chose)','Gronibard','Gronibard - J-ai fait une salade de calamars avec des restes de ciconcision de cedric M. (donc pas grand chose).mp3','e1399bd44bea7326da151557952db4ce',NULL,'2011-02-24 10:01:00',1,34,'2011-02-24 10:16:26','2015-10-16 05:26:48','gronibard-j-ai-fait-une-salade-de-calamars-avec-des-restes-de-ciconcision-de-cedric-m-donc-pas-grand-chose',''