38b4171',NULL,'2012-12-02 15:41:00',1,24,'2012-12-02 15:42:31','2015-10-16 05:43:22','84-merzbow-petitgand',''),(3174,'zapzapzpazpapzapz','38 zap sunra double six eddy louiss','...','38 zap sunra double six eddy louiss.mp3','faadad41f32b1d94aa91d4715cbec0cc',NULL,'2012-12-02 15:42:00',1,24,'2012-12-02 15:43:49','2015-10-16 05:43:23','38-zap-sunra-double-six-eddy-louiss',''),(3175,'zapzapapz','66 total recall reve','...','66 total recall reve.mp3','a6a34fbbd4e7519aff28d26b051b7e01',NULL,'2012-12-02 15:43:00',1,24,'2012-12-02 15:44:45','2015-10-16 05:43:23','66-total-recall-reve',''),(3176,'http://en.wikipedia.org/wiki/Futurama_%28New_York_World%27s_Fair%29     :\r\n\r\nFuturama was an exhibit/ride at the 1939 New York World\'s Fair designed by Norman Bel Geddes that tried to show the world 20 years into the future (1959–1960). Sponsored by the General Motors Corporation, the installation was characterized by its automated highways and vast suburbs. Compared to other \"visions of the future,\" Bel Geddes\' was rather achievable—the most advanced technology posited was the automated highway system, of which General Motors built a working prototype by 1960.[1]\r\n\r\nFuturama is widely held to have first introduced the general American public to the concept of a network of expressways connecting the nation. It provided a direct connection between the streamlined style which was popular in America between 1928 and 1938, and the concept of steady-flow which appeared in street and highway design in the same period.[2] Bel Geddes expounds upon his design in his book Magic Motorways, stating, “Futurama is a large-scale model representing almost every type of terrain in America and illustrating how a motorway system may be laid down over the entire country – across mountains, over rivers and lakes, through cities and past towns – never deviating from a direct course and always adhering to the four basic principles of highway design: safety, comfort, speed and economy.” He had acknowledged this in the belief that “A free-flowing movement of people and goods across our nation is a requirement of modern living and prosperity.”[3]\r\n\r\nThe modeled highway construction emphasized hope for the future as it served as a proposed solution to traffic congestion of the day, and demonstrated the probable development of traffic in proportion to the automotive growth of the next twenty years. Bel Geddes assumed that the automobile would be the same type of carrier and still the most common means of transportation in 1960, albeit with increased vehicle use and traffic lanes also capable of much higher speeds.\r\n\r\nTo meet these assumptions, four general ideas for improvement were incorporated into the exhibition showcase. First, that each section of road be designed to receive greater capacity of traffic. Second, that traffic moving in one direction could be in complete isolation to traffic moving in any other. Third, segregating traffic by subdividing towns and cities into certain units that restrict traffic and allow pedestrians to predominate. And fourth, consequent traffic control for predetermined maximum and minimum speeds. Through this, the exhibition was designed to inspire greater public enthusiasm and support for the constructive work and planning by engineers and public officials who had contributed so much toward improvement of streets and highways.[4]\r\n\r\nThe popularity of the Futurama exhibit fit closely with the fair’s overall theme “The World Of Tomorrow” not just in its emphasis on the future, but also in its redesign of the American landscape. The highway system was supported within a one-acre animated model of a projected America containing more than five hundred thousand individually designed buildings, a million trees of thirteen different species, and approximately fifty thousand motorcars, ten thousand of which traveled along a fourteen-lane multi speed interstate highway. It prophesied an American utopia regulated by an assortment of cutting-edge technologies: remote-controlled multi lane highways, power plants, farms for artificially produced crops, rooftop platforms for individual flying machines and various gadgets, all intended to create an ideal built environment and ultimately to reform society.[5]\r\n\r\nBel Gedde’s ‘future’ was synonymous with technological process, no less in its simulated low-flying airplane journey through the exhibit. The aerial journey was simulated by an eighteen-minute ride on a conveyor system, carrying 552 seated spectators at a time, covering a winding path a third of a mile long through the model. Along with light, sound and colour effects the ride moved at a rate of approximately 120 feet per minute, allowing spectators to look down through a continuous curved pane of glass towards the model. The virtue of this elevated position allowed spectators to see multiple scales simultaneously, viewing city blocks in proportion to a highway system as well as artificially controlled trees in glass domes. This scale was modelled off 408 topographical sections based on aerial photographs of different regions of the US provided by the pioneering company Fairchild Aerial Surveys.[5]','Century 21','Futurama (general motors)','06 Century 21.MP3','b64faeebc0a89ef07165782ff6f90c35',NULL,'2012-12-02 15:44:00',1,24,'2012-12-02 15:48:35','2015-10-16 05:43:23','futurama-general-motors-century-21',''),(3177,'Si je me rappelle bien, ce morceau a été créé pour faire partie d\'une compilation qui devait sortir pour la coupe du monde de football an 2006. C\'est bien la douce voix du chanteur de [Ben et Béné](http://www.benetbene.net) que vous entendez :)\r\n\r\nMerci à Sylvain Sylver de m\'avoir transmis le morceau et [les visuels créés pour l\'occasion](http://imgur.com/a/b8jMc) !','Pense à Séville \'82','Bryan Coco & Ben Narine','Pense_A_Seville_82   radioedit_Ben et BnetSylvainSilver.mp3','5fdf565fc37f31b81f525dcfed3e8f7f',NULL,'2012-12-03 10:16:00',1,1,'2012-12-03 10: