INSERT INTO `post` VALUES (3218,'Les Sunday parties du Boccacio Life International débutaient à 22h pour se terminer très tard le lundi matin, poussant parfois jusqu\'au mardi sans interruption. Des milliers de personnes venues des quatre coins de l\'Europe se déplaçaient pour vivre ces soirées. Il fallait parfois faire jusqu\'à deux heures de file pour accéder à la piste de danse. Les soirées du Boccaccio Life étaient alors (de 1987 à 1992) le point d\'orgue du marathon ininterrompu des discothèques belges allant du vendredi au mardi : le \"Cheops\" à Izegem le vendredi ; \"La Villa\" à Kooigem, \"La Rocca\" à Lier (Anvers), le \"55 (Fifty Five)\" à Kuurne ou la \"Gaîté\" à Bruxelles le samedi ; et enfin le \"Vaudeville\" à Bruxelles ou spécifiquement le \"Boccaccio Life\" à Destelbergen le dimanche.','1/2 Mix Megamix','Public Image Limited','13 1_2 Mix Megamix.mp3','88d916f4cbf1dd95fbfa3de24a24920a',NULL,'2012-12-17 22:35:00',1,32,'2012-12-17 22:43:00','2015-10-16 05:43:42','public-image-limited-1-2-mix-megamix',''),(3219,'Violence volontaire ayant entraîné la mort sans l\'intention de la donner.','99.99 % Kill Money Shot','Testicular Manslaughter','02 99.99 Kill Money Shot.mp3','4542e08d324bfc6791b95663774db297',NULL,'2012-12-17 22:45:00',1,32,'2012-12-17 22:49:27','2015-10-16 05:43:42','testicular-manslaughter-99-99-kill-money-shot',''),(3220,'Historia naturalis Ranarum nostratium','Sex & The Married Frog','Dave Ball, Genesis P. Orridge','05 Sex & The Married Frog.mp3','8e64ebbb021ecab3b39b92d8ab963ccd',NULL,'2012-12-17 23:54:00',1,32,'2012-12-17 23:56:15','2015-10-16 05:43:43','dave-ball-genesis-p-orridge-sex-the-married-frog',''),(3221,'BANG!!!','Hold Up','3 Teens Kill 4','01 Hold Up.mp3','9235854a76683aad7cc7d3c876555fef',NULL,'2012-12-18 00:09:00',1,32,'2012-12-18 00:10:34','2015-10-16 05:43:43','3-teens-kill-4-hold-up',''),(3222,'Certains hommes veulent juste voir le monde brûler. Et y faire cuire un bon rougail saucisse !','Maldon (Remix)','Miss Kat Ween',