n','Debmaster','04 - Le Cheval Africain.mp3','839290146b5d936654e817023130e1a5',NULL,'2013-02-25 12:05:00',1,7,'2013-02-25 12:08:58','2015-10-16 05:45:04','debmaster-le-cheval-africain','http://www.daheardit-records.net/fr/discography/dhr-20'),(3416,'Un morceau sympa pour commencer la journée : Il y a qq temps j\'avais posté ici un morceau fin 80 de Libido, et en cherchant d\'autres choses je suis tombé sur cet album, sorti 10 ans plus tard (en 89) par ce même Hakan Lidbo (qui a l\'air assez connu et qui est vraiment doué). Le style rétro futuriste fait penser au bon côté musical de cette époque, Luke Vibert, Messer Chups, Kubin, Roger Tubesound Ensemble(c\'est pour toi Tristan! mais c\'est un autre morceau) avec ce côté easy scandinave à la Toy ou Jaga Jazzist....\r\n\r\nEt j\'aime bien la bio qu\'il a mis sur discogs pour ce projet : \r\n\r\n\"Bobby Trafalgar did an infinitive number of recordings and soundtracks to some of the strangest films ever made. Unfortunately he hasn’t composed anything in the last 20 years. Some of his songs have recently been re-discovered by todays cult vinyl collectors and reached cult classic status. The main theme from the French adult movie \"Hotel d’amour\" has become something of an underground lounge hit as it was re-released on UK label Repap. Trafalgars obscure music for the Asian 70’s film \"Kung-fu girl\" was used on a TV and radio commercial for JC jeans that was awarded as \"the best song from a commercial 2001\" and the clothing has noticed a 20% increase in sales during the peoriod of the campaign. Not bad for a song with explicit political lyrics sung on chineese in mid 70s. \"','Teenage Crimewave','Bobby Trafalgar','12-teenage crimewave.mp3','780166bec13e1f4c24f84983d70bf6be',NULL,'2013-02-26 09:30:00',1,24,'2013-02-26 09:43:23','2015-10-16 05:45:04','bobby-trafalgar-teenage-crimewave',''),(3417,'Très peu d\'infos sur cet obscur groupe allemand des années \'90 qui a sorti trois albums uniquement sur K7...','Chauvinist'