-14 12:26:00',1,32,'2013-03-14 12:28:58','2015-10-16 05:45:33','aesthetic-perfection-a-nice-place-to-visit',''),(3480,'L’érotomanie est un trouble délirant dans lequel l\'individu affecté est persuadé qu\'il est aimé par un autre individu, habituellement inconnu ou une personnalité. Ce trouble survient lors d\'une psychose, particulièrement chez les patients souffrant de schizophrénie ou de syndrome maniaque. Lors d\'un épisode d\'érotomanie, le patient est persuadé qu\'un « admirateur anonyme » lui déclare son affection, souvent par le biais de télépathie, de messages secrets, de regards, de messages dans les médias. Habituellement, le patient lui retourne cette « affection » en lui écrivant, en lui téléphonant et en lui faisant des cadeaux. Même quand ses avances sont rejetées par la personne qu\'elle aime, les sujets souffrants de cette maladie ne comprennent pas le refus. Elles peuvent ne pas comprendre le refus ou imaginer que leur objet d\'amour délirant use d\'un stratagème pour cacher cet amour interdit au reste du monde.','Bonne Nuit Chuck','Philippe Nicaud','07 Bonne Nuit Chuck.mp3','caf6611b8509badd9180ab581628b3e1',NULL,'2013-03-14 12:34:00',1,32,'2013-03-14 12:36:33','2015-10-16 05:45:34','philippe-nicaud-bonne-nuit-chuck',''),(3482,'\"Gangnam Style\" chanté en opéra par  Jure Godler (timpani & orchestral arrangement) & Tilen Arta? (tenor)\r\n\r\nRotary Charity Concert Ljubljana 2012 - Radio-Television of Slovenia','Gangnam Style','GodART','GodArt - Gangnam style opera.mp3','e8e6ed83970d8a13f0ad6e7be15fff1d',NULL,'2013-03-14 14:00:00',1,79,'2013-03-14 14:02:39','2015-10-16 05:45:34','godart-gangnam-style',''),(3483,'Yesterday des Beatles traduite par \"HIER\" car on est jeudi','Hier','HERVé DE MONS (Le Docteur G)','46 - hier.mp3','7e1f070fdfaed555798ff8a1df0a526f',NULL,'2013-03-14 14:15:00',1,79,'2013-03-14 14:19:07','2015-10-16 05:45:34','herve-de-mons-le-docteur-g-hier',''),(3484,'Un excellent track de musique du cul','Chily Winds','Anal Phazer','03. 