s radios et les boîtes de nuit. Il s\'agit le plus souvent de morceaux légers et dansants destinés à mettre de l\'ambiance lors des soirées en plein air, et ils sont généralement caractérisés par des paroles simples (voire quasi inexistantes) et des mélodies entraînantes qui restent facilement dans la tête. On y retrouve souvent des thèmes et des ambiances exotiques issus des musiques tropicales, mais aussi des titres dance ou de house... ','Cellulites ','Bedtime For Bonzo','07 Cellulites.mp3','3309ce2bdd1f07705a781e9832b0e57d',NULL,'2013-07-01 12:17:00',1,32,'2013-07-01 12:20:29','2015-10-16 05:47:18','bedtime-for-bonzo-cellulites-1',''),(3708,'un jour j\'ai revé qu\'Annie Cordy et moi dansions le zouk ','Annie','Kid Creole & The Coconuts','04 kid creole and the coconuts - annie.mp3','6114363d164c97f76a0e1cdb6319eb39',NULL,'2013-07-01 18:42:00',1,79,'2013-07-01 18:49:56','2015-10-16 05:47:19','kid-creole-the-coconuts-annie',''),(3709,'Un morceau parfait lorsque on reviens de très loin, là où la musique est oubliée et que prudement pour ne pas avoir de frayeurs, on cherche à se  refamilliariser avec la musique .','a panel of experts (Lowfish remix)','Solvent ','solvent - a panel of experts (lowfish remix).mp3','87b5ee398245ec1eb6c11620c8b8d065',NULL,'2013-07-02 01:17:00',1,79,'2013-07-02 01:41:29','2015-10-16 05:47:20','solvent-a-panel-of-experts-lowfish-remix',''),(3710,'Pentathlon moderne.\r\n\r\n![Rodionov](http://2.bp.blogspot.com/_ORjFf0-b4k4/STAEvcJi2OI/AAAAAAAADD8/V7ndBNuiMys/s320/Folder.JPG)\r\n','Gaming Slot Machine (pistol shooting)','A. Rodionov','A. Rodionov - Gaming Slot Machine (pistol shooting).mp3','f8ed03b4b11d8d609f055a00c39b55db',NULL,'2013-07-03 16:16:00',1,37,'2013-07-03 16:23:19','2015-10-16 05:47:20','a-rodionov-gaming-slot-machine-pistol-shooting',''),(3711,'Aujourd\'hui, au Pérou. ','De Dia','Qechuaboi','1. Qechuaboi - De dia.mp3','3cbd0d507acd8eb47a12e6d539fe7fba',NULL,'2013-07-03 18:21:00',1,25,'2013-07-03 18:24:57','2015-10-16 05:47:21','